import React from "react";

function RecipeCard(props) {
  return (
    <div className={'card m-'}>
    <div className={'card-body'}>
       <img width={'200px'} className={''} src={props.image} alt={'recipe'} className={'card-img'}></img>
       <div className={''}>
          <h5 className={'card-title p-3 mb-2 bg-secondary text-white'}>{props.title}</h5>
          <p className={'card-text'}>{props.summary}</p>
       </div>
    </div>
    </div>
  )
}

export default RecipeCard;
